import React from 'react';

const Contact = () => {
    return (
        <div className={'contact-page container-dft'}>
            <h1>Keep in touch !</h1>
            <div className='users'>
                <div className='user'>
                    <p className='fullname'></p>
                    <p className='description'></p>
                    <div className='socials'>
                        <img className="icon-mail" src="./images/icon_mail.svg" alt="Icon mail" />
                        <img className="icon-mail" src="./images/icon_mail.svg" alt="Icon mail" />
                        <img className="icon-mail" src="./images/icon_mail.svg" alt="Icon mail" />
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Contact;
